import React from 'react'

const Row = () => {
  return (
    <tr>
        {Object.entries(item).map(([key , value]) => {
           return(
               <Cell key = {key}  cellData = {JSON.stringify(item)}/>
           )
        })}
    </tr>
  ) 
}

export default Row
